import React from 'react'
import {Container, Image} from 'react-bootstrap'

import logo from '../resources/grzyby.jpg'

export default function Start() {
    return (
        <Container>
            <img src={logo} alt="Logo" />
            <Image src={logo} fluid />
        </Container>
    )
}
